fr:
  name: Mariannes du Nord
  description: >-
    Les îles Mariannes du Nord font partie de l'archipel des Mariannes dans
    locéan Pacifique, au nord de Guam. Elles forment un commonwealth américain,
    en partenariat avec les tats-Unis dont elles sont un territoire organisé non
    incorporé.
  officialName: Iles Mariannes du Nord
